import React from 'react';
import DentalImage from './DentalDeserts/DentalDeserts.GIF';
import './App.css';
function DentalDeserts(props) {
    return (
        <div>
          <h1>DentalDeserts</h1>
          <img src={CFDentalImageImage} className="CommuteImage" alt="DentalImage" />
        </div>
      )
}



export default DentalDeserts;
